__NUXT_JSONP__("/drugs/Olinvacimab", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"2095504-49-5",chebiId:b,chemicalFormula:b,definition:"A fully human monoclonal antibody targeting the vascular endothelial growth factor receptor 2 (VEGFR2), with potential antiangiogenic activity. Upon administration, olinvacimab specifically binds to VEGFR2, thereby preventing the binding of its ligand VEGF. This may result in the inhibition of tumor angiogenesis and a decrease in tumor nutrient supply. VEGFR2 is a pro-angiogenic growth factor receptor tyrosine kinase expressed by endothelial cells, while VEGF is overexpressed in many tumors and is correlated to tumor progression.",fdaUniiCode:"VFH55IZ5VI",identifier:"C102877",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C2496","C93170"],synonyms:["OLINVACIMAB",a,"TTAC-0001"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FOlinvacimab",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Olinvacimab","","2021-10-30T13:17:17.033Z")));